import React from 'react';
import Link from 'next/link';
import User from '../../components/user';

const authIndexPage = () => (  
    <div>
        <h1>The Auth Index Page</h1>
        <p>Go to <Link href="/"><a>Home</a></Link></p>
        <User name ='Max' age={28} />
    </div>
);

export default authIndexPage;
